pub enum CorsError {

    /// The HTTP request header `Origin` is required but was not provided
    #[display(fmt =
              "The HTTP request header `Origin` is required but was not provided")]
    MissingOrigin,

    /// The HTTP request header `Origin` could not be parsed correctly.
    #[display(fmt =
              "The HTTP request header `Origin` could not be parsed correctly.")]
    BadOrigin,

    /// The request header `Access-Control-Request-Method` is required but is
    /// missing
    #[display(fmt =
              "The request header `Access-Control-Request-Method` is required but is missing")]
    MissingRequestMethod,

    /// The request header `Access-Control-Request-Method` has an invalid value
    #[display(fmt =
              "The request header `Access-Control-Request-Method` has an invalid value")]
    BadRequestMethod,

    /// The request header `Access-Control-Request-Headers`  has an invalid
    /// value
    #[display(fmt =
              "The request header `Access-Control-Request-Headers`  has an invalid value")]
    BadRequestHeaders,

    /// Origin is not allowed to make this request
    #[display(fmt = "Origin is not allowed to make this request")]
    OriginNotAllowed,

    /// Requested method is not allowed
    #[display(fmt = "Requested method is not allowed")]
    MethodNotAllowed,

    /// One or more headers requested are not allowed
    #[display(fmt = "One or more headers requested are not allowed")]
    HeadersNotAllowed,
}

pub enum AllOrSome<T> {

    /// Everything is allowed. Usually equivalent to the "*" value.
    All,

    /// Only some of `T` is allowed
    Some(T),
}
